import Layout from "../components/Layout";

function HomePage() {
  return (
    <Layout>
      <h1>Contact me!</h1>
      <form action="/">
        <label>
          Name
          <input type="text" id="name" />
        </label>

        <label >
          Email
          <input type="email" id="email" />
        </label>

        <label >
          Subject
          <input type="text" id="subject" />
        </label>

        <label>
          Text
          <textarea id="text" />
        </label>

        <button type="submit">Send</button>
      </form>
      <style jsx>{`

      form{
        display: flex;
        flex-direction: column;
      }

      button{
        width: max-content;
        justify-self: center;
      }

      `}
      </style>
    </Layout>
  );
}

export default HomePage;
